import React from 'react'
import { Route } from 'react-router-dom'
import Weather from './weather'
import Search from './search'
import Location from './location'

function App() {
  var map;
  return (
    <div className="App">
         <Route exact path='/' render={()=><Weather></Weather>}></Route>
         <Route exact path='/search' render={()=><Search></Search>}></Route>
         <Route exact path='/location' render={()=><Location></Location>}></Route>
         <script src='https://webapi.amap.com/maps?v=1.4.15&key=1a274afe15bb5dbafa7e800ccfcf99ff'></script>
         <script>
           {
              map=new AMap.Map('map-container',{
               center:[117,36],
               zoom:11
             })
           }
         </script>
    </div>
  );
}

export default App;
